#!/usr/bin/perl
use strict;
use warnings;
use Hash::PriorityQueue;

my @grid = map { [split //] } <DATA>;

my %visited;
my $queue = Hash::PriorityQueue->new;
for my $i (0..$#grid) {
    for my $j (0..$#{$grid[$i]}) {
        if ($grid[$i][$j] eq 'S') {
            $queue->insert([$i, $j], 0, [1, 0], [[$i, $j]]);
            $visited{"$i,$j"} = 1;
        }
    }
}
my @directions = ([0, 1], [1, 0], [0, -1], [-1, 0]);




